var socialsMediaSupport = {
    facebook: {
        name: 'facebook',
        image: 'data:image/png;base64,'
    },
    instegram: {
        name: 'instegram',
        image: 'data:image/jpeg;base64,'
    },
    telegram: {
        name: 'telegram',
        image: 'data:image/png;base64,'
    },
    twitter: {
        name: 'twitter',
        image: 'data:image/jpeg;base64,'
    },
    linkedin: {
        name: 'linkedin',
        image: 'data:image/png;base64,'
    }
}

function warningNotification(text) {
    console.warn(`%c ${text}`, 'background: #ffdc18; color: red')
}

function createAHrefElement(currentimg, url, clss) {
    var img = document.createElement('img');
    img.src = currentimg;
    var a = document.createElement('a');
    a.href = url;
    a.target = '_blank'
    a.classList.add(clss)
    a.appendChild(img);
    return a;
}

function imgSelection(socialName) {
    return socialsMediaSupport[socialName] ? socialsMediaSupport[socialName].image : false;
}

function URLvalidation(url) {
    return (/^(ftp|http|https):\/\/[^ "]+$/.test(url)) ? url : '';
}

function socialCreation(name, url, clss) {
    return createAHrefElement(imgSelection(name), URLvalidation(url), clss);
}

function style() {
    var style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = `
        socials-ruler {
            position: fixed;
            transform: translateY(-50%);
            top: 50%;
            left: -40px;
            display: flex;
            flex-direction: column;
            animation: moveRight 1s .5s both;
        }
        .social {
            display: flex;
        }
        .social > img {
            width: 40px;
            transition: .4s all;
        }

        .social > img:hover {
            width: 50px;
        }

        @keyframes moveRight {
            0% {left: -40px;}
            100% {left: 0;}
        }
    `;
    return style;
}

function onInit() {
    try {
        document.head.appendChild(style());
        var wrapper = document.querySelector('socials-ruler');
        var attributes = wrapper.attributes;
        Array.from(attributes).forEach(social => {
            if (socialsMediaSupport[social.name]) {
                if (URLvalidation(social.value)) {
                    wrapper.appendChild(socialCreation(social.name, social.value, 'social'));
                } else if (social.name !== 'class') {
                    warningNotification(`SOCIALS API WARNING: ${social.name} was not added Because Invalid URL!`);
                }
            } else {
                (social.name !== 'class') ? warningNotification(`${social.name} not supported on this Library ..`): null;
            }
        })

    } catch (e) {
        console.error('Something Wrong implementing Socials Library -->', e);
    }
}

(function checkBodyExist() {
    if (document['body']) {
        onInit();
    } else {
        setTimeout(checkBodyExist, 0);
    }
})()